Inside the Mind of Edward Snowden

Sociopolitical Documentary hosted by Brian Williams, published by NBC in 2014 - English narration


Information
------------------------------

In his first American television interview, Edward Snowden defended his disclosure of the American government's use of surveillance programs to spy on its own people, and described himself as a patriot for trying to stop violations of the Constitution. 
Snowden met for about five hours last week with &quot;NBC Nightly News&quot; anchor Brian Williams at a hotel in Moscow, where Snowden is living in exile while facing U.S. felony charges. Snowden walked out of the NSA with tens of thousands of documents on thumb drives, documents that he says he has released to journalists. These documents disclosed the global reach of U.S. intelligence, including descriptions of government surveillance of U.S. telephone and email records, tapping of undersea fiber-optic cables carrying internet traffic, and accessing Yahoo and Google's internal user data without either company's knowledge.

